import React, { useState } from 'react';

function Contacts() {
  let api = "http://127.0.0.1:8090/api/collections/contacts/records/";
  let profiles = [];

fetch(api)
.then(response => response.json())
.then(data => {
    profiles = data.items;
    console.log(profiles[0])
});

  return (
    <div>{profiles[0].created}</div>
  );
  };

export default Contacts;
